import React from 'react'

const InfoAuthModal = info => {
  const styleObj = {
    position: 'absolute',
    top: '0',
    left: '50%',
    transform: 'translateX(-50%)',
  }

  return <div style={styleObj}>{info}</div>
}

export default InfoAuthModal
